      "title": "Hadley Clay Studio",
      "announcement": "Search &quot;In Stock&quot; in my shop to see what&#39;s ready to go! Welcome to Hadley Clay Studio on Etsy! Featured in: Every Day with Rachael Ray - Apartment Therapy - BuzzFeed - Scout Mob - UncommonGoods - set of 2 Broke Girls CBS - Etsy Blog - Atlanta Home Interiors - bringing you modern artful ceramics for the home and urban garden.\r\n\r\nBehind the scenes:\r\npinterest: @hadleyclay\r\ntwitter: @hadleyclay\r\ninstagram: @hadleyclaystudio\r\nfacebook: @hadleyclay\r\n\r\nVisit my website for new products, show schedule, studio happenings and promos:\r\nwww.hadleyclay.com\r\n\r\nCustom and special requests are welcome! ",
      "currency_code": "USD",
      "is_vacation": false,
      "vacation_message": null,
      "sale_message": "Thank you for shopping handmade! Upon shipping, you will receive confirmation and a tracking number.\r\n\r\nShould you have any questions or updates to this order please contact me as soon as possible for my prompt reply.\r\n\r\nCheers!\r\nHadley",
      "digital_sale_message": null,
      "last_updated_tsz": 1434362102,
      "listing_active_count": 78,
      "login_name": "hadleyclay",
      "accepts_custom_requests": true,
      "policy_welcome": "Welcome to Hadley Clay Studio on Etsy! I hope you enjoy my handmade creations. To see my studio, work-in-progress, plus more info and links visit my new &#39;About&#39; page:\r\nhttp://www.etsy.com/shop/hadleyclay/about/\r\n\r\nHadley Clay Studio is the incorporated body of work by Hadley Sedgwick, founded in 2009. Every piece produced in Hadley Clay Studio is original and handmade by me, Hadley Sedgwick.\r\n\r\nIf you would like an item that is not currently in stock, please send me a convo and I will let you know when I will have your item back in stock.",
      "policy_payment": "I accept PAYPAL and ETSY direct check out (with credit cards) due at time order is placed. \r\n\r\nHadley Clay Studio is a Registered Business in the State of Georgia - sales tax of 8% will automatically be applied for residents of Georgia.\r\n\r\nCustomers in the US can pay with a check.\r\n\r\nPayment must be made in full and have cleared before the item is shipped. ",
      "policy_shipping": "All items in-stock ship the following business day. If it is a custom item please allow 2-4 weeks for delivery.\r\n\r\nI use UPS for commercial and USPS for residential and international. If you need expedited shipping please contact me. All shipments are insured. \r\n\r\nHadley Clay Studio ships worldwide, if your country is not listed on the specific item you would like, please contact me and I will set it up for you. I am not responsible for any customs charges if they are applied. That matter is to be taken up between the customer and the customs department of the governing branch of their own country.\r\n\r\nP A C K A G I N G\r\n★ Artwork is wrapped in 100% recycled materials\r\n★ Corrugated boxes and gift boxes (included with most smaller items) are made in the USA from 100% recycled fibers and are suitable for reuse.\r\n\r\nG I F T S \r\nOrders are shipped to ETSY account addresses. Please provide me with alternative address if needed.\r\nIf your order is a gift, going directly to the recipient, I can include a personal message card from you with no extra charge. If you would like this service please let me know what you would like me to write (to fit on a postcard) in the &quot;message to seller&quot; during checkout. \r\nGift wrapping is available for any item:\r\nhttps://www.etsy.com/listing/117557269/gift-wrapping-add-on-option\r\n\r\nD A M A G E S\r\nI take great care in packaging these fragile ceramics for their safe arrival. While transit-related damage is very rare, it can happen. PLEASE inspect all packages upon delivery. Should you find that your item has been on some unexpected adventures during shipment and arrives broken, report any damage to Hadley Clay Studio at the time of delivery for a full refund or store credit.",
      "policy_refunds": "Great care is taken to assure that everyone is completely satisfied. If you are unhappy with your order for any reason please contact me within 5 working days of receiving your package. I will do my best to resolve the problem quickly. Refunds and exchanges are considered on a case-by-case basis.",
      "policy_additional": "M A I L I N G  - L I S T\r\nCustomers are automatically placed on my studio email list. Your privacy is kept. I use this list 1-2 times a year to notify customers about new products, show schedule, studio happenings and promos. There is always an option to opt out. \r\n\r\nC U S T O M - O R D E R S \r\nI welcome custom orders! Please contact me with your ideas and I will be happy to create a special sculpture just for you. \r\nCustom order items require design and production time. You will receive an estimate of both time and cost upon ordering. I will create an ETSY listing just for you and must it be paid in full before I begin creating the piece. They cost an additional 20% per piece and around 1-3 weeks for completion, depending on the complexity of the design. Custom orders may not be returned unless defective or damaged during shipment.\r\n\r\nW H O L E S A L E \r\nYes, I offer wholesale! Please contact me for pricing, terms, or your copy of my 2013 Wholesale Catalog. You can also shop online at www.wholesalecrafts.com (artist number 25385).\r\n\r\nC O N S I G N M E N T \r\nAt this time I am unable to offer orders on consignment.\r\n\r\nE C O - F R I E N D L Y\r\nI strive to be Earth-friendly and energy conscious. I consider and investigate clays, glazes, and shipping materials to make informed choices and work towards a studio with zero waste.\r\nCeramic production uses a lot of energy, and many of the ingredients in glazes and the clay body itself are mined from the Earth, toxic and cancer causing in their raw form. I take steps to reduce harm to the environment and myself in my studio. Since I opened my studio I have been engaging in environmentally responsible ceramic studio practices.\r\n★ I use several different clay bodies, depending on the item. All of the clay I use is talc-free, guided by a firm commitment toward product safety. \r\n★ The glazes I use do not contain lead. I mix many of my glazes from raw materials in a well-ventilated area. After firing they are food-safe and non-toxic.\r\n★ The construction process is all by hand and doesn’t use an electric potter’s wheel or ram press.\r\n★ My kilns are oxidation, high efficiency, computerized and emit no harmful gases. \r\n\r\nP L E A S E - N O T E\r\nPart of what makes my style unique is the lovably flawed characteristics. Everything in my shop is handmade. My artwork may have tiny cracks or uneven glazed surfaces. I ensure that these imperfections will not interfere with the form or functionality, only add to the aesthetic.\r\nI do my best to capture the true color of my work in the photographs, but please note that colors may appear differently on your screen.\r\n\r\nAll work is copyright by Hadley Clay Studio 2013-2014 / All rights reserved. Artwork may not be reproduced, copied or used to create derivative works without my permission",
