      "sale_message": "Thank you for selecting Beach House Living® brand flatware.  The pay pal address is used as the default shipping address. International Shoppers: By purchasing it is agreed tax/vat due on the item(s) actual selling price is paid by buyer and is not included in the items price or shipping\r\n\r\nNow you can subscribe to my mailing list for special offers and new products.\r\nhttp://eepurl.com/r988P",
