      "policy_refunds": " Your computer monitor may reflect colors differently then mine so please allow for color variations. \r\n\r\nGreat effort is made to describe items listed in my shop. Please read the complete description carefully most of your questions can be answered there. Should I have missed something please send a convo. \r\n\r\nCustom and/or personalized items are not returnable. or exchangeable.\r\nSample sale as is final sale or clearance items are not returnable or exchangeable.\r\n\r\nNEW, ADDITIONAL, AMMENDED POLICIES as of APRIL 15,2011\r\nThe right to charge a re-stock fee of 20% is reserved for general exchanges/returns of stock items\r\n\r\nAny personalized or custom orders are non refundable, or exchangeable for any reason. Requests for exchanges or returns on a stock item shall be within 48 hours of receipt and a return authorization number will be issued. Since most US domestic items are shipped with delivery confirmation the U.S. postal services date and time of delivery will be used.   Shipping fees are not refundable. Shipping fees for exchanges or returns are at buyer&#39;s expense incoming and outgoing.\r\n\r\nItem must be in original condition, with all original packaging and with all accessories if applicable for example  a storage pouch shall be returned. All items shall be wrapped to prevent scratching and/or damage and securely boxed, sent with delivery confirmation and returned within 4 business days with tracking information.\r\n",
      "policy_additional": "My work has appeared in Bon Appetit, Flea Market Gardens and Stuff Boston Magazines and a cookbook titled from Manuela with Love.\r\n\r\nYour item will be similar to the one in the photo but the exact placement and depth of the design or letter may vary.\r\n\r\nCustom and/or personalized items are not returnable.  Should an error have been made such as a misspelling or wrong date please contact me immediately.  \r\n\r\nYour item will be similar to the one in the photo but the exact placement and depth of the design or letter may vary. \r\n\r\nBeach House Living, Wedding Dress Flowers, Regatta Bags and Regatta Rags, Mr. & Mrs. forks and spoons, Bride &Groom forks, His & Hers forks, Yours & Mine forks Just Married spoons, Happily Ever After spoons, non flatten I Love you spoons, Mermaid Garden spoons,  I Do wedding forks, hammered art spoons, Your ice cream my ice cream spoons, his and hers spoons, Sweet tooth fork products,photographs, written content and respective slogans Rescued Re-imagined Reformed. Mr. & Mrs forks Mr. & Mrs, wedding forks hand stamped wedding silverware, Bride and Groom forks Bride & Groom wedding forks hand stamped wedding silverware. Get Stuffed, Eat Drink Get Stuffed.  All Rights Reserved 2009-2015\r\n  \r\nEtsy is also where new product lines have been making their on line debut named Regatta Bags(tm) and Regatta Rags(tm) which are made from Rescued materials that have been Re-imagined and Reformed to fun accessories.  My wedding dress flowers(tm) are my original designs made from vintage or discarded wedding gowns that have been combined with either other vintage, recycled or new fabrics.\r\n",
