    "title": "Garden Marker with Stake, Peas sign, Hand routed on 400+ year-old Cedar barn wood that was hand split 100+ years ago. Very primitive",
    "description": "This marker is cut on 400+ year-old Western Red Cedar, hand split by Finnish pioneers, well over 100-years ago.  This one measures (give or take) 1/2&quot; thick, 6&quot; tall and 10 1/2” wide.\n\nYou won’t find wood with history like this at the big box cookie cutter store.  Our garden markers are a bit more expensive, cause we don’t use a cheap piece of fence board.  We lovingly hand route the letters and don’t use a makeshift machine that cuts every letter on every marker exactly the same in 60 seconds\n\nThey come with extra stakes and brass screws.  Every garden sign we create is a different size and shape, some have nail holes and some don’t.  Very few have knots, because the old time pioneers that cut the tree down didn’t bother with the knotty wood.  Two or three trees were more than enough to build a cabin, barn and outhouse.\n\nWe have a marker for just about everything grown in a garden or orchard.  If we don’t have one you want, my wife and I will make ya one lickety-split.\n\nUntil about 30 years ago we had two cabins and a barn, then one cabin and the barn collapsed in a wind storm.  Now we are using the wood from the collapsed buildings to renovate the remaining cabin.  These markers are scraps from the ends of planks that are too long or not wide enough for our renovations.\n\nYou don’t even need to bring these signs in for the winter.  This old growth wood has been out in the weather for over 100-years and will last for another 100 or so.  When Lewis and Clark came through this area, the tree this wood came from was already very old.  Five children were born and raised in the cabin.  There was no electricity, water or toilet.  The wood cook stove (still there) was the only heat, and coal oil lanterns (still there) the only light.  There are names and dates carved all over the front face of the remaining cabin.\n\nWood like this don’t grow on trees anymore.  If ya find some, IT’S VERY SPECIAL.  We can make you another type of sign with it, but keep in mind that we will only make serious signs on this wood.  No funny, ha ha stuff.  Only, love, peace, tranquility or beauty.  As Mother Nature intended, the colors, textures, and character will be different for every piece of this beautiful wood.  Sorry if this ad rambled on a bit, but this wood gets me all excited and stuff.\n\nIf you would like to see more of our signs please visit both of our Etsy shops\nFOR CUSTOM SIGNS GO TO:\thttps://www.etsy.com/shop/SolitudeValley\nFOR READY TO GO SIGNS:\thttps://www.etsy.com/shop/tripeeesign\n00083",
