    "title": "Pretty Orange succulent in acacia wooden planter pot - Perfect floral arrangement for your mom this Mother&#39;s Day",
    "description": "Unique Home decor gifts for Halloween, Holidays, Christmas, Fall, Weddings, housewarmings, office decor, birthdays and special occasions! If you are looking for some Unique gifts that live forever then this one is for you. Everything will be shipped via USPS 2-days priority Mail. Upgraded shipping for zero cost just for Holidays! ACT NOW!\n\nGreat Gifts for House Warming parties, Wedding party favors, Baby shower favors, Thanksgivings, Christmas and New year! We can do small party favors. Unique way to show your loved ones how much you love them... \n\nBeautiful & Colorful succulents in gorgeous acacia wood planter pot. Drought tolerant plants that shines with very little water.\n\nThis is a unique shaped succulent plant. It grows into beautiful succulent plant with time and when given proper sun, the red edges just becomes more prominent.\n\nSucculents should be watered generously in the summer. The potting mix should be allowed to dry between waterings, but do not underwater. During the winter, when the plants go dormant, cut watering back to once every other month. Overwatering and ensuing plant rot is the single most common cause of plant failure. \n\nPACKAGE INCLUDES:\nWell rotted succulents, ready to be potted and packaged with great care\nwooden acacia bowl 3.75&quot; dia. x 1.75&quot;H\nHigh Quality Succulent potting mix. I add more nutrients to my soil perfect for succulents.\nIt will be shipped via USPS Priority mail.",
