      "accepts_custom_requests": false,
      "policy_welcome": "WELCOME\r\n\r\nWelcome to French Vintage Fancies.\r\nOur wish, is to make your purchase\r\na pleasurable and satisfying shopping experience.\r\n\r\nWe provide all of our customers with a quality, professional service.\r\nThe antiques and vintage collectible items we sell are accurately described.\r\n\r\nWe offer combined shipping costs on multiple purchases, if dispatched together.\r\nWe do not charge for packaging. Our packaging is always secure, adequate and labelled clearly. ( we do recycle some items of packaging if possible, to reduce our carbon footprint, but this does not affect the quality of our packaging ).\r\n\r\nAll purchases are dispatched quickly and we notify you as soon as we have dispatched your item.\r\n\r\nObviously, we keep our customers informed as much as we can.\r\n\r\nMaking you happy, is what makes us happy. ",
      "policy_payment": "PAYMENT\r\n\r\nWe accept payment via PayPal and Etsy Direct Checkout where most major Credit and Debit Cards are accepted.......\r\nWe prefer Paypal and Etsy Direct Checkout where it is safe and secure for both you and us... ",
      "policy_shipping": "SHIPPING\r\n\r\nOur policy is to ship items at the most competitive rates for you, ensuring you get your purchases safe and sound....\r\nAll items are shipped by Airmail with Tracking and &quot; Signed-For &quot;on arrival at your door...\r\n\r\nCharges depend on size, weight and country of delivery. All rates are fixed by the French Postal Service, not us. We do not add any additional costs.\r\n\r\nThe price of shipping does not include insurance. If you require insurance for your purchase, please contact me for a quote before purchasing.\r\n\r\nWe are happy to combine shipping for multiple purchases, reducing shipping charges for you, our valued customer. ",
      "policy_refunds": "REFUNDS\r\n\r\nRefunds will only be made upon return of items that are not as described ( minus postage costs ).\r\n\r\nDamaged items can only be refunded if insured and after lodging a claim with the French Postal Service ( La Poste, France ). The decision and payment is based on their subsequent enquiries ...\r\n\r\nLost items ( Very rare occurrence, especially with tracking ). We will need to contact the French Postal Service for a refund. This will take a little time and we ask for your patience, should this happen.... ",
      "policy_additional": "All of our items are Original Antique or Vintage Collectible and described as such.\r\n\r\nA description of condition is included in the description of the item/s.\r\n\r\nWe describe all items as accurately as possible.\r\nCustomers must however bear in mind, that these are antique and vintage items and may have a little age related wear. For this reason we try to make our pictures as clear and revealing as possible...\r\n\r\nWe are happy to answer additional questions about items, as long as we can give an accurate reply.\r\nIf we don&#39;t know and cannot find the answer, we will tell you so...\r\n\r\nAny other queries, please contact us with your question...\r\nWe&#39;re happy to help if we can ...\r\n\r\nWe look forward to doing business with you....\r\n\r\nElizabeth\r\nat\r\nFrench Vintage Fancies",
