    "title": "Indoor/Outdoor Living wall. 100% Handmade Cedar Succulent Hanging Planter. Awesome Gift!",
    "description": "This is for a Handmade Cedar framed vertical succulent garden a.k.a. Living Wall. This handmade Living Wall measures approximately 10&quot; x 30&quot; x 4&quot; and is constructed completely from hand stained Cedar wood. It comes with adequate drainage holes on the back, an attached wall hanger, and comes already planted with living rooting succulents. This Living Wall can be hung either vertical or horizontal.\r\n\r\nBring it indoors and improve your quality of life! Living Walls add a very unique and cool charm to any home setting as well as any outdoor environment. They are great for hanging inside or outside.\r\n\r\nRedwood or Cedar is optional, as well as color variation, since all this work is custom done by myself. If this Stained Cedar frame isn&#39;t you, just let me know what you&#39;re looking for, and I&#39;ll gladly make it! I encourage the challenge!\r\n\r\nCaring for your Living Wall:\r\nThis Living wall and these succulent plants are extremely easy to maintain! Water when plants/medium look dry, about every week or so. When watering is needed, just remove from the wall and heavily mist plants and moss till wet. Allow the Living Wall to properly drain, let it dry, and rehang! We also include instructions for watering, pruning, and caring for your living wall when purchased.\r\n\r\n \r\n\r\nFor optimal life, place in a location with great indirect light or good morning sunshine.\r\n\r\n**The one pictured is an example of what yours will look like but with some slight flower and wood stain variations**\r\n\r\n\r\n*** Due to the large amount of orders this item won&#39;t be ready to ship  for 1-2 business weeks. . It takes time, these are 100% handmade and planted***\r\n\r\n\r\nThanks for checking out my work. For more questions or custom orders, please contact me at my shop page at https://www.etsy.com/shop/OneWithPlants",
