      "shop_name": "OneWithPlants",
      "user_id": 35959298,
      "creation_tsz": 1388812675,
      "title": "Handmade Living Succulent Walls",
      "announcement": "One with Plants offers custom handcrafted Living Wall arrangements and Planters. These are living planters, they&#39;re not just temporary arrangements.\r\n\r\nWe also do private events, special orders, weddings, and custom orders. Please inquire within or visit my website at www.OnewithPlants.com  Thanks for shopping! Cheers!\r\nOne With Plants",
      "currency_code": "USD",
      "is_vacation": false,
      "vacation_message": null,
      "sale_message": "Thank you so much for purchasing one of my handmade succulent living walls! I will begin making your Living wall asap and as soon as it&#39;s in the post I will be sending you a confirmation message with tracking number for your records. \r\n\r\nWhen you receive the item, it is best to give it up to a week + laying on its back in a nice warm sunny environment to help increase the rooting process. After your Living wall has had time to acclimate, it’s time to find it a nice bright, sunny home. Ideally, it likes bright light with partial sun. Too much sun can cause the leaves to burn, so early morning sunlight or indirect afternoon light is best.\r\n \r\nSucculents love water but hate to be regularly wet! So this means water occasionally but let the soil dry in-between watering. If the soil is to wet, the roots can rot and the plants will not flourish. For watering, first check the soil/moss to see if it needs watering. If it feels a little damp, leave it be. Only water if the soil is completely dry. If dry, remove and mist the moss/soil heavily till completely damp. Allow proper time for it to completely drain before rehanging, wipe off excess water, and rehang!\r\n\r\nSucculents are low-maintenance and loyal. Just pick a spot with sunlight, water occasionally, and watch them grow! \r\n\r\nI also do custom orders and larger orders for weddings, parties, offices, and events all at competitive pricing. Please inquire within for any special requests.\r\n\r\nThanks for shopping! I&#39;ll be in contact shortly.\r\n\r\nNed\r\nOne with Plants\r\n\r\n",
