      "policy_refunds": "We guarantee the plants for 1 week after purchase. After one week, no refunds or exchanges. This guarantee does not include the occasional breakage of petals, plants get damaged sometimes during the shipping process. If damage occurs to the living wall, you can replace and regrow new plants easily, just follow my DIY instructions online.",
