    "description": "Back by popular demand for another wonderful gardening season!!  Wood garden marker stakes for herbs or vegetable garden rows.  Very rustic and beautiful way to mark your plants plus add a very down to earth flair.\n\nTruly unique and gorgeous gift for that gardener in the household!\n\nEach garden marker stake is approximately 14&quot;  - 15&quot; high, 3/8 - 1/2&quot; thick and 2&quot; - 3&quot; wide. Metal stake is slightly used, roughly straigtened, and you can cut it to the length desired or just push it farther into soil.  \n\nGarden marker stakes are sliced birch pieces, with wood burned lettering on one side, then lightly sealed to preserve it&#39;s natural beauty for you to enjoy for many years.\n\nSold in sets of six, just choose herb or vegetable that you want on the garden marker stakes, then choose between printed or handwritten lettering, let us know in message box when ordering or convo.\n\nNOTE:  Please be aware that these garden markers are made from real wood and can produce cracks and also fading if place in direct sunlight, it&#39;s not a bad thing in fact we feel that this will enhance an already rustic look.\n\n\nWill ship worldwide, please message for Hawaii, Alaska or international shipping quote.",
